import React from 'react';
import './Css/table.css'
import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    title: [],
    description: []
  }


  componentDidMount() {
    axios.get(`https://api.github.com/users/mikifriki/repos`)
      .then(rest => {
        const title = rest.data;
        const description = rest.data;
        this.setState({description})
        this.setState({ title });
      })



  }

  render() {
    return (
        <table>
  <tr>
    <th>Company</th>
    <th>Contact</th>
    <th>Country</th>
  </tr>
  <td>
  { this.state.title.map(title => <tr>{title.name}</tr>)}
  </td>
  <td>
  { this.state.title.map(title => <tr>{title.name}</tr>)}
  </td>


  <tr>
    <td>Centro comercial Moctezuma</td>
    <td>Francisco Chang</td>
    <td>Mexico</td>
  </tr>
  <tr>
    <td>Ernst Handel</td>
    <td>Roland Mendel</td>
    <td>Austria</td>
  </tr>
  <tr>
    <td>Island Trading</td>
    <td>Helen Bennett</td>
    <td>UK</td>
  </tr>
  <tr>
    <td>Laughing Bacchus Winecellars</td>
    <td>Yoshi Tannamuri</td>
    <td>Canada</td>
  </tr>
  <tr>
    <td>Magazzini Alimentari Riuniti</td>
    <td>Giovanni Rovelli</td>
    <td>Italy</td>
  </tr>
</table>
/*       <table>
        <tr>
        <th>He</th>
        { this.state.title.map(title => <tr>{title.name}</tr>)}
        </tr>

        { this.state.description.map(description=> <li>{description.description}</li>)}
      </table> */
    )
  }
}
